import React from 'react';
import './stil.css';
import { Button, Form, FormControl, Card} from "react-bootstrap";

class AddSynonym extends React.Component {
  render() {
    return (
      <div className="main-div">
            <Card style={{ width: '55rem' }} id="prva">
              <Card.Body>
                <Card.Title id="naslov"> Add your synonym </Card.Title>
            
                  <Form>
                    <Form.Text> Add a word</Form.Text>
                    <FormControl type="text" placeholder="Enter a word" id="bar" />
                    <Form.Text> Add a synonym</Form.Text>
                    <FormControl type="text" placeholder="Enter synonyms" id="bar" />
                    <Button variant="outline-warning">Search</Button>
                  </Form>
                  
                  <Button variant="outline-warning" id="add"> Add your synonyms </Button>
              </Card.Body>
            </Card>
      </div>
    );
  }
}

export default AddSynonym;
